import "./App.css";
import Navbar from "./components/NavBar";
import NavItem from "./components/NavItem";
import { ReactComponent as CaretIcon } from "./icons/caret.svg";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Navbar>
          <NavItem icon={<CaretIcon />}>
            <ul>
              <li>
                <a href="">Profile</a>
              </li>
              <li>
                <a href="">Setting</a>
              </li>

              <li>
                <a href="">Logout</a>
              </li>
            </ul>
          </NavItem>
        </Navbar>
      </header>
    </div>
  );
}

export default App;
